import React from 'react';

const Login = (props) => {

    // const handleSubmit = (event) => {
    //     event.prefentDefault();


    // }

    return (
        <form name="Cards" className="form form_cards-add" novalidate>
        <h2 classNameName="form__title">Новое место</h2>
        <fieldset className="form__fieldset">
            <label className="form__field">
                <input id="place-input" name="place" autocomplete="off" placeholder="Название" type="text"
                    className="form__input form__input_type_title" required minlength="2" maxlength="30" />

            </label>
            <label className="form__field">
                <input id="link-input" name="link" autocomplete="off" placeholder="Ссылка на картинку"
                    type="url" className="form__input form__input_type_link" required />

            </label>
        </fieldset>
        <button type="submit" className="form__submit form__submit_type-add"
            aria-label="сохранить изменения">Создать
        </button>
    </form>
    )
}

export default Login;
